import React, { Component } from 'react'
import { Card, CardContent, CardMedia, Typography } from '@material-ui/core';
import { Carousel, CarouselSlide } from 'material-ui-carousel'

class photoCarousel extends Component {
    pictures= [
        {image: '../images/photography/beaufort.jpg', title: 'Beautiful Beaufort'},
        {image: '../images/photography/Cake.jpg', title: 'Cake'},
        {image: '../images/photography/Downtown-Bridge-yo.jpg', title: 'Downtown Beaufort'},
        {image: '../images/photography/expanse.jpg', title: 'The Expanse'},
        {image: '../images/photography/Fripp.jpg', title: 'Stormy Daze'},
        {image: '../images/photography/houses.jpg', title: 'Beach Houses'},
        {image: '../images/photography/IMG_0140-1.JPG', title: 'Sunset'},
        {image: '../images/photography/IMG_6175.JPG', title: 'The Charles'},
        {image: '../images/photography/nature.jpg', title: 'Home'},
        {image: '../images/photography/newpoint.jpg', title: 'The Dock'},
        {image: '../images/photography/sunnyday.jpg', title: 'Sunny Boston'}
    ]

    render () {
        return (
            <Carousel>
        {this.pictures.map(({ image, title }) => (
          <CarouselSlide key={image}>
            <Card>
              <CardMedia
                image={image}
                title={title}
                style={{
                  height: 0,
                  paddingTop: '75%',
                }}
              />
              <CardContent>
                <Typography>{title}</Typography>
              </CardContent>
            </Card>
          </CarouselSlide>
        ))}
      </Carousel>
        )
    }
}

export default photoCarousel;
